Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 4259/88 of 19 December 1988 applying generalized tariff preferences for 1989 in respect of textile products originating in developing countries (1), and in particular Article 13 thereof,
Whereas Article 11 of Regulation (EEC) No 4259/88 provides that preferential tariff treatment shall be accorded, for each category of products subjected in Annexes I and II to individual ceilings, within the limits of the quantities specified in column 8 of its Annex I and in column 7 of its Annex II, in respect of certain or each of the countries or territories of origin referred to in column 5 of the same Annexes;
Whereas Article 12 of that Regulation provides that the levying of customs duties may be re-established at any time in respect of imports of the products in question once the relevant individual ceilings have been reached at Community level;
Whereas, in respect of men's or boys' suits and ensembles, other than knitted or crocheted, products of category No 16 (code 40.0160) and women's or girls' skirts, products of category No 27 (code 40.0270), the relevant ceiling amounts respectively to 94 000 and 248 000 pieces;
Whereas on 21 April 1989 imports of the products in question into the Community originating in India, a country covered by preferential tariff arrangements, reached and where charged against that ceiling;
Whereas it is appropriate to re-introduce the levying of customs duties for the products in question with regard to India,
